sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
    var arrayUtil = new global.ArrayUtil();
    var response = JSON.parse(inputs.response_body);
    if (arrayUtil.contains(successCodes, inputs.status)) {
        outputs.status = 'Success';
        var profile = response['value'];
        var profileNames = [];
        var endpointNames = [];
        profile.forEach(function(property) {
            if (property.name) {
                profileNames.push(property.name);
            }
            if (property.properties.endpoints) {
                for (endpointIndex in property.properties.endpoints) {
                    endpointNames.push(property.properties.endpoints[endpointIndex].name);
                }
            }
        });
        outputs.endpoint_names = endpointNames;
        outputs.profile_names = profileNames;
      	outputs.profile_details = JSON.stringify(profile);
    } else {
        outputs.status = 'Error';
        if (response.error)
            outputs.error_message = response.error.message;
        else
            outputs.error_message = response.message;
    }
})(inputs, outputs);

